import React from 'react';
import PropTypes from 'prop-types';
import './detailpagee.css';

const DetailPagee = ({ title, description, image }) => {
  return (
    <div className="detail-pagee">
      <div className="content">
      <img src={image} alt={title} className="detail-imagee" />
        <div className='text'>
            <h2 className="detail-titlee">{title}</h2>
        <p className="detail-descriptionn">
          {description.map((part, index) => (
            <React.Fragment key={index}>
              {part}
            </React.Fragment>
          ))}
        </p>
        </div>
      </div>
    </div>
  );
};

DetailPagee.propTypes = {
  title: PropTypes.string.isRequired,
  description: PropTypes.arrayOf(PropTypes.string).isRequired,
  image: PropTypes.string.isRequired,
};

export default DetailPagee;
